    public byte[] clenseAudio(byte[] audio)
    {
        AudioInputStream inStream=null;
        AudioInputStream in2=null;
        ByteArrayOutputStream bout= new ByteArrayOutputStream();
        
        byte[] cleansedAudio=null;
        try {
            inStream= AudioSystem.getAudioInputStream(new ByteArrayInputStream(audio));
            AudioFormat format = inStream.getFormat();
            System.out.println("inStream:"+inStream.getFrameLength());
            System.out.println("Channel:"+format.getChannels());
            System.out.println("getSampleRate:"+format.getSampleRate());
            System.out.println("getSampleSizeInBits:"+format.getSampleSizeInBits());
            System.out.println("getFrameRate:"+format.getFrameRate());
            System.out.println("getFrameSize:"+format.getFrameSize());
            System.out.println("format.getEncoding():"+format.getEncoding());
            in2 = AudioSystem.getAudioInputStream(new AudioFormat(format.getEncoding(), 32000, 16, 1, 2, 32000, format.isBigEndian()), inStream);
            System.out.println("in2:"+in2.getFrameLength());
            //write the audio file in targeted pitch file
            
            AudioSystem.write(in2, AudioFileFormat.Type.WAVE, bout);
            cleansedAudio=bout.toByteArray();
        } catch (UnsupportedAudioFileException | IOException e) {
            // TODO Auto-generated catch block
            e.printStackTrace();
        }
        finally{
            try {
                in2.close();
                bout.close();
                inStream.close();
            } catch (IOException e) {
                // TODO Auto-generated catch block
                e.printStackTrace();
            }
            
        }
        return cleansedAudio;
    }
